import React from 'react';
import logo from './nuslogo.jpg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="Logo is missing!" />
        <p>
          Welcome to Fintech@SG Course! This is my first React App.
        </p>
        <a
          className="App-link"
          href="www.youtube.com"
          target="_blank"
          rel="noopener noreferrer"
        >
          Youtube
        </a>
      </header>
    </div>
  );
}

export default App;
